import React from "react";
import { Routes, Route } from "react-router-dom";
import "./App.css";
import { ContractPage } from "./pages/ContractPage";
import { FormPage } from "./pages/FormPage";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/movies" element={<FormPage />} />
        <Route path="/movies/:id" element={<ContractPage status={""} iin={""} fullNameOfOrganization={""} secondName={""} firstName={""} fathersName={""} email={""} phone={""} position={""} responsobilities={""} region={null} area={""} adress={""} bank={""} bik={""} iik={""} kbe={""} />} />
      </Routes>
      <FormPage />
    </div>
  );
}

export default App;
